19	Country Sausage Gravy	{789592192149,74574835511,656846510519,742365228001,258561000001,890459002317}	{16,0.400000000000000022,1,16,2,1}	In a skillet on medium heat cook pork, onion, green pepper, red pepper flakes, and garlic until pork is crumbly. Drain off excess fat, but leave a small amount.\nCombine butter, salt, and pepper with the meat mixture and stir until butter melts. Slowly sift flour over the top. Mix gently and allow mixture to cook for 5 minutes. It will burn, so do not let it sit unguarded. Dont forget to scrape the bottom of the pan. Add the sage and thyme.\nSlowly stir in milk, about a half a cup at a time, and incorporate it well. When the mixture thickens, add more milk. Do not let it boil vigorously, or it will burn. Add chicken bullion and let cook for five minutes. Again, if it thickens too much, add more milk. Adjust taste with more salt and pepper if needed.\nJust before serving, add the parsley, and about a 1/4 cup more milk; the gravy will thicken quickly as it cools.\n\n	\\
10	Pancakes	{890459002317,742365228001,43723001305}	{8,8,1}	Beat eggs, oil, and milk together, and add to flour. Stir until combined.\nHeat a greased griddle until drops of water sprinkled on it evaporate noisily. Pour 1/8 to 1/4 cup batter onto the griddle. Turn over with a metal spatula when bubbles begin to form on top. Cook second side to a golden brown color.\n	\\
1	Chicken Parmesan	{796549833307,258561000001,767563565949,77344930140,43723001305}	{8,1,3,8,2}	Preheat an oven to 450 degrees F (230 degrees C).\nPlace chicken breasts between two sheets of heavy plastic (resealable freezer bags work well) on a solid, level surface. Firmly pound chicken with the smooth side of a meat mallet to a thickness of 1/2-inch. Season chicken thoroughly with salt and pepper.\nBeat eggs in a shallow bowl and set aside.\nMix bread crumbs and 1/2 cup Parmesan in a separate bowl, set aside.\nPlace flour in a sifter or strainer; sprinkle over chicken breasts, evenly coating both sides.\nDip flour coated chicken breast in beaten eggs. Transfer breast to breadcrumb mixture, pressing the crumbs into both sides. Repeat for each breast. Set aside breaded chicken breasts for about 15 minutes.\nHeat 1 cup olive oil in a large skillet on medium-high heat until it begins to shimmer. Cook chicken until golden, about 2 minutes on each side. The chicken will finish cooking in the oven.\nPlace chicken in a baking dish and top each breast with about 1/3 cup of tomato sauce. Layer each chicken breast with equal amounts of mozzarella cheese, fresh basil, and provolone cheese. Sprinkle 1 to 2 tablespoons of Parmesan cheese on top and drizzle with 1 tablespoon olive oil.\nBake in the preheated oven until cheese is browned and bubbly, and chicken breasts are no longer pink in the center, 15 to 20 minutes. An instant-read thermometer inserted into the center should read at least 165 degrees F (74 degrees C).\n	\\
2	Gujrati Kadhi	{11384232031,5055476118099}	{16,1}	Mix the water, yogurt, and chickpea flour together in a large saucepan until smooth; add the green chile peppers, ginger, sugar, turmeric, and salt. Bring the mixture to a boil and then immediately reduce heat to low; cook on low 5 to 10 minutes.\nHeat the oil and ghee together in a small skillet over medium heat; fry the dried red chile peppers, curry leaves, cumin seeds, mustard seed, and asafetida powder in the the mixture until the seeds splutter. Stir the mixture into the saucepan with the cilantro. Serve hot.\n	\\
3	Macaroni and Cheese	{804345000356,73080000055,99222545413,93966000283}	{12,6,4,1}	Bring a large pot of lightly salted water to a boil. Add pasta and cook for 8 to 10 minutes or until al dente; drain.\nReturn drained pasta to the pot. Mix in processed cheese, Cheddar cheese, and cream. Stir until cheeses melt. Sprinkle with salt.\n\n	\\
4	Hamburger	{752907606976,99222545413,77028855820,496569000890,43723001305}	{24,4,0.200000000000000011,0.200000000000000011,1}	Preheat a grill for high heat.\nIn a large bowl, mix together the ground beef, onion, cheese, soy sauce, Worcestershire sauce, egg, onion soup mix, garlic, garlic powder, parsley, basil, oregano, rosemary, salt, and pepper. Form into 4 patties.\nGrill patties for 5 minutes per side on the hot grill, or until well done. Serve on buns with your favorite condiments.\n	\\
5	Fried Rice	{5057065462033,74574835511}	{12,0.200000000000000011}	In a saucepan bring water to a boil. Stir in rice. Reduce heat, cover and simmer for 20 minutes.\nMeanwhile, heat peanut oil in a large skillet or wok over medium heat. Add onions, bell pepper, garlic and pepper flakes, to taste. Cook 3 minutes, stirring occasionally.\nIncrease heat to medium-high and stir in cooked rice, green onions and soy sauce. Stir-fry for 1 minute. Add peas and cook 1 minute more. Remove from heat. Add sesame oil and mix well. Garnish with peanuts, if desired.\n	\\
6	Pizza	{656846510519,890459002317,742365228001,73080000055,74574835511,258561000001}	{2,26,8,6,1,8}	To Make Sauce: Melt butter in a small saucepan over medium heat. Blend in salt, pepper and flour, then stir in the milk and Romano cheese. Simmer, stirring constantly, until thickened. Remove from heat, cover and set aside.\nTo Make the Garlic Butter: Melt the butter in a small saucepan over medium heat. Blend in the garlic, rosemary, and salt. Cook, stirring constantly, until garlic is tender but not browned. Remove from heat, cover and set aside.\nTo Make the Dough: Pour the warm water into a small bowl and stir in the yeast until dissolved. Allow to rest until yeast foams, about 5 minutes. Mix the vegetable oil, sugar, salt, rosemary, and garlic powder together in a mixing bowl. Stir in the yeast mixture, and gradually stir in the flour. Gather into a loose ball and knead until a smooth ball forms. Cover, and let rest 1/2 hour.\nPreheat oven to 400 degrees F (200 degrees C). Season the roasted chicken with rosemary, thyme, poultry seasoning, garlic powder and salt. Chop or shred and reserve.\nTo Assemble the Pizza: Spread dough out on prepared pizza stone. Top with cooled garlic butter, covering entire crust. Next spread with Alfredo Sauce (if necessary, warm to spreading consistency), leaving crust edges. Top with chicken, turning to coat with sauce.\nBake in preheated oven for 20 minutes, or until bottom crust is lightly browned. Remove from oven and let set for 2 to 3 minutes before cutting.\n	\\
7	Mashed Potatoes	{656846510519,742365228001}	{2,4}	Place the potatoes into a large pot, and cover with salted water. Bring to a boil, reduce heat to medium-low, cover, and simmer until tender, 20 to 25 minutes. Drain, and return the potatoes to the pot. Turn heat to high, and allow the potatoes to dry for about 30 seconds. Turn off the heat.\nMash the potatoes with a potato masher twice around the pot, then add the butter and milk. Continue to mash until smooth and fluffy. Whisk in the salt and black pepper until evenly distributed, about 15 seconds.\n	\\
8	Dal Makhani	{24182003888,74574835511,8000320994968,656846510519,94966000283}	{8,3,8,2,4}	Place lentils and kidney beans in a large bowl; cover with plenty of water. Soak for at least 2 hours or overnight. Drain.\nCook lentils, kidney beans, 5 cups water, and salt in a pot over medium heat until tender, stirring occasionally, about 1 hour. Remove from heat and set aside. Keep the lentils, kidney beans, and any excess cooking water in the pot.\nHeat vegetable oil in a saucepan over medium-high heat. Cook cumin seeds in the hot oil until they begin to pop, 1 to 2 minutes. Add cardamom pods, cinnamon stick, bay leaves, and cloves; cook until bay leaves turn brown, about 1 minute. Reduce heat to medium-low; add ginger paste, garlic paste, turmeric, and cayenne pepper. Stir to coat.\nStir tomato puree into spice mixture; cook over medium heat until slightly reduced, about 5 minutes. Add chili powder, coriander, and butter; cook and stir until butter is melted.\nStir lentils, kidney beans and any leftover cooking water into tomato mixture; bring to a boil, reduce heat to low. Stir fenugreek into lentil mixture. Cover saucepan and simmer until heated through, stirring occasionally, about 45 minutes. Add cream and cook until heated through, 2 to 4 minutes.8;Dal Makhani;{24182003888,74574835511,8000320994968,656846510519,94966000283};{8,3,8,2,4}\nPlace lentils and kidney beans in a large bowl; cover with plenty of water. Soak for at least 2 hours or overnight. Drain.\nCook lentils, kidney beans, 5 cups water, and salt in a pot over medium heat until tender, stirring occasionally, about 1 hour. Remove from heat and set aside. Keep the lentils, kidney beans, and any excess cooking water in the pot.\nHeat vegetable oil in a saucepan over medium-high heat. Cook cumin seeds in the hot oil until they begin to pop, 1 to 2 minutes. Add cardamom pods, cinnamon stick, bay leaves, and cloves; cook until bay leaves turn brown, about 1 minute. Reduce heat to medium-low; add ginger paste