ntil mixture. Cover saucepan and simmer until heated through, stirring occasionally, about 45 minutes. Add cream and cook until heated through, 2 to 4 minutes.\n	\\
9	Pav Bhaji	{74574835511,84253240086,41331024679,834183002113,656846510519}	{0.400000000000000022,1,4,4,1}	Heat the oil in a wok over medium heat. Saute garlic and green chile for 30 seconds, then stir in onions and ginger. Cook until onions are brown. Add tomatoes, and cook until pasty. Stir in cauliflower, cabbage, peas, carrots and potatoes. Season with pav bhaji masala. Cover, and cook for 15 minutes, stirring occasionally. Season with salt, and stir in lemon juice.\nToast the dinner rolls, and spread lightly with butter. Serve garnished with chopped onion, green chile and cilantro.\n	\\
11	Lasagna	{789592192149,752907606976,74574835511,77344930140,84253240086,8000320994968,767563565949,72368510934,43723001305,73080000055}	{16,16,4,8,2,6,4,2,1,16}	Brown sausage and ground beef with onion and garlic in a large Dutch oven or heavy pot over medium heat, cooking and stirring until meat is cooked through, 10 to 15 minutes. Drain and discard grease. Stir tomato sauce, crushed tomatoes, Italian-style crushed tomatoes, tomato paste, basil, 2 tablespoons parsley, brown sugar, salt, Italian seasoning, black pepper, fennel seeds, and 1/2 cup Parmesan cheese into meat mixture. Bring to a boil, reduce heat to low, and simmer sauce for at least 1 hour (up to 6 for best flavor). Stir occasionally.\nPlace lasagna noodles into a deep bowl and cover with very hot tap water; let soak for 30 minutes.\nBeat egg in a bowl and stir ricotta cheese, 2 tablespoons parsley, 1/2 teaspoon salt, and nutmeg into egg until thoroughly combined.\nPreheat oven to 375 degrees F (190 degrees C).\nCover bottom of a 9x13-inch baking dish with 1 cup sauce. Layer 4 soaked lasagna noodles, 1/3 of the ricotta cheese mixture, 1/3 of the shredded mozzarella cheese, and 1/4 cup Parmesan cheese in the dish. Repeat layers twice more, ending with mozzarella and Parmesan cheeses. Cover dish with aluminum foil.\nBake until lasagna noodles are tender and casserole is bubbling, about 50 minutes. Remove foil and bake until cheese topping is lightly browned, 15 to 20 more minutes. Let stand 15 minutes before serving.\n\n	\\
12	Sandwich	{656846510519,99222545413}	{2,2}	Preheat skillet over medium heat. Generously butter one side of a slice of bread. Place bread butter-side-down onto skillet bottom and add 1 slice of cheese. Butter a second slice of bread on one side and place butter-side-up on top of sandwich. Grill until lightly browned and flip over; continue grilling until cheese is melted. Repeat with remaining 2 slices of bread, butter and slice of cheese.\n	\\
13	Chicken Biryani	{74574835511,84253240086,11384232031,258561000001,5057065462033}	{0.400000000000000022,2,1,12,16}	In a large skillet, in 2 tablespoons vegetable oil (or ghee) fry potatoes until brown, drain and reserve the potatoes. Add remaining 2 tablespoons oil to the skillet and fry onion, garlic and ginger until onion is soft and golden. Add chili, pepper, turmeric, cumin, salt and the tomatoes. Fry, stirring constantly for 5 minutes. Add yogurt, mint, cardamom and cinnamon stick. Cover and cook over low heat, stirring occasionally until the tomatoes are cooked to a pulp. It may be necessary to add a little hot water if the mixture becomes too dry and starts to stick to the pan.\nWhen the mixture is thick and smooth, add the chicken pieces and stir well to coat them with the spice mixture. Cover and cook over very low heat until the chicken is tender, approximately 35 to 45 minutes. There should only be a little very thick gravy left when chicken is finished cooking. If necessary cook uncovered for a few minutes to reduce the gravy.\nWash rice well and drain in colander for at least 30 minutes.\nIn a large skillet, heat vegetable oil (or ghee) and fry the onions until they are golden. Add saffron, cardamom, cloves, cinnamon stick, ginger and rice. Stir continuously until the rice is coated with the spices.\nIn a medium-size pot, heat the chicken stock and salt. When the mixture is hot pour it over the rice and stir well. Add the chicken mixture and the potatoes; gently mix them into the rice. Bring to boil. Cover the saucepan tightly, turn heat to very low and steam for 20 minutes. Do not lift lid or stir while cooking. Spoon biryani onto a warm serving dish.\n	\\
14	Pesto Chicken Penne Casserole	{767563565949,804345000356,258561000001,14500001900,8000320994968,742365228001}	{4,16,24,24,12,12}	Preheat an oven to 350 degrees F (175 degrees C). Grease a 9x13-inch baking dish. Combine the bread crumbs, Parmesan cheese, and olive oil in a small bowl until evenly moistened; set aside.\nFill a large pot with lightly salted water and bring to a rolling boil over high heat. Once the water is boiling, stir in the penne, and return to a boil. Cook the pasta uncovered, stirring occasionally, until the pasta has cooked through, but is still firm to the bite, about 11 minutes. Drain well in a colander set in the sink.\nMeanwhile, combine the chicken in a bowl with the Italian cheese blend, spinach, tomatoes, alfredo sauce, pesto sauce, and milk. Stir in the pasta once done, and scoop into the prepared baking dish. Top with the bread crumb mixture.\nBake in the preheated oven until bubbly and golden brown on top, 40 to 45 minutes.\n	\\
15	Pork Chops	{43723001305,74574835511,220812000009}	{2,0,1,6}	Preheat the oven to 375 degrees F (190 degrees C).\nIn a shallow bowl or pie plate, whisk eggs with garlic powder and onion powder. Place cracker crumbs on a separate plate. Heat the oil in a large skillet over medium-high heat. Dip pork chops into the egg, then press in the cracker crumbs to coat. Fry in the hot oil for 2 to 3 minutes per side, just until golden brown. Remove to a baking sheet.\nBake for 45 minutes in the preheated oven, turning once. Serve immediately.\n	\\
16	Noodles	{890459002317,43723001305,742365228001}	{8,1,0.400000000000000022}	Combine egg, salt, milk. Add flour. (For thicker noodles add baking powder to flour before mixing.) Separate into two balls.\nRoll out dough, and let stand for 20 minutes.\nCut into strips and spread to dry--dust with a little flour. Let dry for approximately 2 hours.\nDrop into hot soup--cook for about 10 minutes.\n	\\
17	Scrambled eggs	{43723001305,742365228001}	{4,2}	In a medium bowl, whisk together the eggs and milk using a fork. Whisk in the salt and pepper.\nHeat a small non-stick pan over medium heat. Pour the egg mixture into the pan, and cook. Stir, scrape, and cut up the eggs while cooking until no liquid remains. Enjoy!\n	\\
18	Omelet	{43723001305,99222545413,8000320994968}	{2,4,0.400000000000000022}	Crack the eggs into a large resealable freezer bag. Press out most of the air, and seal. Shake or squeeze to beat the eggs. Open the bag, and add the ham, cheese, onion, green pepper, tomato, salsa, and mushrooms. Squeeze out as much of the air as you can, and seal the bag.\nBring a large pot of water to a boil. Place up to 8 bags at a time into the boiling water. Cook for exactly 13 minutes. Open the bag, and let the omelet roll out onto a plate. The omelet should roll out easily.\n	\\
20	Chicken Tikka Masala	{11384232031,258561000001,74574835511,84253240086,8000320994968,93966000283}	{2,16,0.200000000000000011,2,4,4}	Combine yogurt, 2 teaspoons garam masala, paprika, black pepper, 1/2 teaspoon salt, cayenne pepper, and 1/2 teaspoon coriander in a large bowl. Add chicken strips and toss to coat. Cover and marinate in the refrigerator for 2 hours.\nPreheat oven to 450 degrees F (230 degrees C). Grease a baking sheet.\nPlace chicken strips on the prepared baking sheet, leaving space between each piece, and bake in the preheated oven until browned and no longer pink inside, about 10 minutes. Remove and set aside.\nHeat vegetable oil in a large skillet over medium heat. Cook and stir cumin seeds until lightly toasted and aromatic, about 3 minutes. Add onion; cook and stir until onion begins to soften, 4 to 5 minutes. Stir in garlic, ginger, and green chiles and continue to cook until onion is browned, 15 to 20 minutes. Cook and stir tomatoes, tomato paste, and water into onion mixture until tomatoes begin to break down and incorporate into the onion mixture, about 10 minutes.\nCook and stir 1 teaspoon garam masala, 1/2 teaspoon coriander, and turmeric into the tomato mixture. Mix in the cooked chicken, add cream, and stir to coat. Cover and let simmer for 10 minutes. Season with 1/2 teaspoon salt and garnish with cilantro.\n	\\
